import React, { useState, useEffect } from "react";
import axios from "axios";

function DeleteRating() {
    // State to hold the delete data
    const [deleterating, setdeleterating] = useState([]);

    // Fetch delete data from the API
    useEffect(() => {
      axios.get("http://localhost/COMP333_HW3/index.php/deleterating")
        .then((response) => {
          setdeleterating(response.data);
        })
        .catch((error) => {
          console.error("Error fetching delete rating data:", error);
        });
    }, []);

    return (
      <div>
        <h1>Delete Rating</h1>
        <ul>
          {deleterating.map((deleterating) => (
            <li key={deleterating.id}>
              Username: {deleterating.username}, Id: {deleterating.id}
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default DeleteRating;
